// convertBooleansToInt converts a slice of bools to a binary representation.
//
// Example:
//
//	convertBooleansToInt(true, false, true, true) = 0b1011
func convertBooleansToInt(args ...bool) int {
	res := 0

	for k, v := range args {
		if v {
			res = res | 0x1
		}

		if len(args)-1 != k {
			res = res << 1
		}
	}

	return res
}
